import React from 'react';
import BentoGrid from "@bentogrid/core";

const NewHome = () => {

    
  return (
    <div className='background'>
        <div class="bentogrid">
        <div data-bento="1x1"></div>
        <div data-bento="2x2"></div>
        <div data-bento="2x1"></div>
    </div>

    </div>
  );
}

export default NewHome;
